export function Render()
{

    sendColors();
}
function sendColors(shutdown = false){

    var packet = []
    packet[0x00]   = 0x00;
    packet[0x01]   = 0x08;    
    packet[0x02]   = 0x06;
    packet[0x03]   = endpointVal//0x01; // seen 0 and 1
    packet[0x04]   = 0x85;
    packet[0x05]   = 1;
    packet[0x06]   = 0x00;
    packet[0x07]   = 0x00;
    packet[0x08]   = 0x12;
    

    for(var iIdx = 0; iIdx < vKeys.length; iIdx++)
    {
        var iPxX = vKeyPositions[iIdx][0];
        var iPxY = vKeyPositions[iIdx][1];
        var mxPxColor;
        if(shutdown){
            mxPxColor = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            mxPxColor = hexToRgb(forcedColor)
        }else{
            mxPxColor = device.color(iPxX, iPxY);
        }
        packet[22+vKeys[iIdx]*3] = mxPxColor[0];
        packet[22+vKeys[iIdx]*3 +1 ] = mxPxColor[1];
        packet[22+vKeys[iIdx]*3 +2 ] = mxPxColor[2];
    }
    device.write(packet, 1025);
        //Check for Error
        packet[3] = 0x00
        packet = device.read(packet,1025)
        if(packet[3] == 3){
            errors += 1;
            if(errors > 1){
                //device.log(packet[3]);
                //device.log(errors)
                errors = 0;
                
                sendPacketString(`00 08 05 ${savedStartUpValue}`,1025);
                savedStartUpValue = savedStartUpValue == 1 ? 0 : 1;
                device.log("Selected Lighting Handle: " + savedStartUpValue);
                Initialize();
            }

        }
}


